import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import './AccidentReport.css';
import './HomePage.css';

const AccidentReport = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    reporterName: '',
    incidentDate: '',
    incidentTime: '',
    location: '',
    incidentType: 'slip',
    description: '',
    injuries: '',
    witnesses: '',
    files: null
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleFileChange = (e) => {
    setFormData(prev => ({
      ...prev,
      files: e.target.files
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setError('');

    if (!formData.reporterName || !formData.incidentDate || !formData.location) {
      setError('Please fill in all required fields');
      setIsSubmitting(false);
      return;
    }

    try {
      const formPayload = new FormData();
      Object.entries(formData).forEach(([key, value]) => {
        if (key === 'files' && value) {
          Array.from(value).forEach(file => {
            formPayload.append('files', file);
          });
        } else if (value) {
          formPayload.append(key, value);
        }
      });

      await new Promise(resolve => setTimeout(resolve, 1500));
      console.log('Form submitted:', formData);
      alert('Accident report submitted successfully!');
      navigate('/dashboard');
    } catch (err) {
      setError('Failed to submit report. Please try again.');
      console.error('Submission error:', err);
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="home-page">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="container">
          <div className="logo nav-links">
            <Link to="/">
              <img src="/images/SpeakUp-Her.png" alt="SpeakUpHer Logo" className="logo-image" />
            </Link>
          </div>
          <div className="nav-links">
            <Link to="/features">Features</Link>
            <Link to="/account">Account</Link>
            <Link to="/about">About</Link>
            <Link to="/dashboard" className="btn-secondary">Dashboard</Link>
          </div>
        </div>
      </nav>

      <div className="accident-report-container">
        <div className="report-header">
          <h1>Incident Report Form</h1>
          <p>Please provide details about the workplace incident</p>
        </div>

        {error && <div className="error-message">{error}</div>}

        <form onSubmit={handleSubmit} className="report-form">
          {/* All your form fields remain exactly the same */}
          {/* ... */}
        </form>
      </div>

      {/* Footer */}
      <footer className="footer">
        <div className="container">
          <div className="footer-content">
            <div className="footer-section">
              <h4>SpeakUpHer</h4>
              <p>Making workplaces safer since 2025</p>
            </div>
            <div className="footer-section">
              <h4>Resources</h4>
              <Link to="/features">Features</Link>
              <Link to="/privacy">Privacy Policy</Link>
            </div>
            <div className="footer-section">
              <h4>Company</h4>
              <Link to="/about">About Us</Link>
            </div>
            <div className="footer-section">
              <h4>Support</h4>
              <Link to="/contact">Contact Us</Link>
            </div>
          </div>
          <div className="footer-bottom">
            <p>Â© 2025 SpeakUpHer. All rights reserved.</p>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default AccidentReport;
